import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <section className="hero-section">
      <div className="hero-content">
        <h1 className="hero-title fade-in">
          <span className="highlight">Tackling the<br />
          problems of today<br /> whilst creating the leaders of tomorrow.</span>
        </h1>
        <h3 className="hero-subtitle fade-in">
          <strong>
            JOIN US TO ENGAGE THE NEXT GENERATION OF ENTREPRENEURIAL LEADERS TO USE INNOVATION AND BUSINESS TO IMPROVE THE WORLD.
          </strong>
        </h3>
      </div>
    </section>
  );
};

export default Home;
